import React from "react";
import HourlyRateCalculator from "./HourlyRateCalculator";

function App() {
	return (
		<div>
			<header className="App-header">
				<h1>Simple Hourly Rate Converter</h1>
				<p>Calculate your earnings</p>
			</header>
			<div className="App">
				<HourlyRateCalculator />
			</div>
		</div>
	);
}

export default App;
